import PropTypes from 'prop-types';
import React, { useEffect, useState } from "react"
import { withTranslation } from "react-i18next"
import { Link } from "react-router-dom"
import {
    Table,
    Card,
    CardBody,
    Pagination,
    PaginationItem,
    PaginationLink,
    CardFooter,
    Button,
    Row,
    Col,
} from "reactstrap"
import ApiServicesDetalleDocumentacion from '../../../../services/DocumentacionLegal/ApiServicesDetalleDocumentacion';
import { BpmServices, BackendServices } from "../../../../services";
import { useLocation, useHistory } from "react-router-dom";
import * as url from "../../../../helpers/url_helper"
import SweetAlert from "react-bootstrap-sweetalert"
import { AvField, AvForm, AvGroup } from 'availity-reactstrap-validation';
import Switch from "react-switch";
import { useTranslation } from 'react-i18next';
import Currency from '../../../../helpers/currency';

const Offsymbol = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                height: "100%",
                fontSize: 12,
                color: "#fff",
                paddingRight: 2,
            }}
        >
            {" "}
            No
        </div>
    );
};
const OnSymbol = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                height: "100%",
                fontSize: 12,
                color: "#fff",
                paddingRight: 2,
            }}
        >
            {" "}
            Si
        </div>
    );
};
const estiloTotales = { backgroundColor: "lightgrey !important", color: "black !important", textAlign: "center" }
const CostosNotaria = (props) => {
    const [switch1, setswitch1] = useState(false);
    const [switch2, setswitch2] = useState(false);
    const [switch3, setswitch3] = useState(false);
    const [switch4, setswitch4] = useState(false);
    const [switch5, setswitch5] = useState(false);
    const [switch6, setswitch6] = useState(false);
    const [switch7, setswitch7] = useState(false);
    const [switch8, setswitch8] = useState(false);
    const [switch9, setswitch9] = useState(false);
    const [switch10, setswitch10] = useState(false);
    const [switch11, setswitch11] = useState(false);
    const [switch12, setswitch12] = useState(false);
    const [total, settotal] = useState(0);
    const { t, i18n } = useTranslation();
    const currencyData = new Currency();
    const apiServiceBackend = new BackendServices();
    const location = useLocation()
    const [openModalRiesgo, setopenModalRiesgo] = useState(false);
    const [dataRows, setdataRows] = useState(null);
    const [messageNotAvailable, setmessageNotAvailable] = useState(false);
    const [locationData, setLocationData] = useState(location.data);
    const history = useHistory();
    React.useEffect(() => {
        let dataSession;
        if (location.data !== null && location.data !== undefined) {
            if (location.data.transactionId === undefined || location.data.transactionId.length <= 0) {
                history.push(url.URL_DASHBOARD);
            } else {
                sessionStorage.setItem('locationData', JSON.stringify(location.data));
                setLocationData(location.data);
                dataSession = location.data;
            }
        } else {
            //chequeamos si tenemos guardado en session
            var result = sessionStorage.getItem('locationData');

            if (result !== undefined && result !== null) {
                result = JSON.parse(result);
                setLocationData(result);
                dataSession = result;
            }
        }

    }, [!locationData]);
    function check() {
        settotal(0)
        let check1 = document.getElementById("check1") ? document.getElementById("check1").checked : false;
        let check2 = document.getElementById("check2") ? document.getElementById("check2").checked : false;
        let check3 = document.getElementById("check3") ? document.getElementById("check3").checked : false;
        let check4 = document.getElementById("check4") ? document.getElementById("check4").checked : false;
        let check5 = document.getElementById("check5") ? document.getElementById("check5").checked : false;
        let check6 = document.getElementById("check6") ? document.getElementById("check6").checked : false;
        let check7 = document.getElementById("check7") ? document.getElementById("check7").checked : false;
        let check8 = document.getElementById("check8") ? document.getElementById("check8").checked : false;
        let check9 = document.getElementById("check9") ? document.getElementById("check9").checked : false;
        let check10 = document.getElementById("check10") ? document.getElementById("check10").checked : false;
        let check11 = document.getElementById("check11") ? document.getElementById("check11").checked : false;
        let check12 = document.getElementById("check12") ? document.getElementById("check12").checked : false;
        let jsonValues = {
            value1: 0,
            value2: 0,
            value3: 0,
            value4: 0,
            value5: 0,
            value6: 0,
            value7: 0,
            value8: 0,
            value9: 0,
            value10: 0,
            value11: 0,
            value12: 0
        }
        if (check1 == true) {
            jsonValues.value1 = 545.00;
        }
        if (check2 == true) {
            jsonValues.value2 = 580.00
        }
        if (check3 == true) {
            jsonValues.value3 = 498.00
        }
        if (check4 == true) {
            jsonValues.value4 = 680.00;
        }
        if (check5 == true) {
            jsonValues.value5 = 890.00;
        }
        if (check6 == true) {
            jsonValues.value6 = 400.00;
        }
        if (check7 == true) {
            jsonValues.value7 = 460.00;
        }
        if (check8 == true) {
            jsonValues.value8 = 420.00;
        }
        if (check9 == true) {
            jsonValues.value9 = 450.00;
        }
        if (check10 == true) {
            jsonValues.value10 = 370.00;
        }
        if (check11 == true) {
            jsonValues.value11 = 625.00;
        }
        if (check12 == true) {
            jsonValues.value12 = 375.00;
        }
        settotal(() => {
            return parseFloat(jsonValues.value1) + parseFloat(jsonValues.value2) + parseFloat(jsonValues.value3) + parseFloat(jsonValues.value4) + parseFloat(jsonValues.value5) + parseFloat(jsonValues.value6) + parseFloat(jsonValues.value7) + parseFloat(jsonValues.value8) + parseFloat(jsonValues.value9) + parseFloat(jsonValues.value10) + parseFloat(jsonValues.value11) + parseFloat(jsonValues.value12);
        })
    }
    return (
        <React.Fragment>
            <AvForm>
                <Row>
                    <Col md="12">
                        <div className="table-responsive styled-table-div">
                            <Table className="table table-striped table-hover styled-table table ">
                                <thead>
                                    <tr style={{ textAlign: "center" }}>
                                        <td>Tipo de caso</td>
                                        <td>Contiene</td>
                                        <td>Precio aproximado</td>
                                        {/* <td>Monto</td> */}
                                        <td>Aplica línea</td>
                                    </tr>
                                </thead>
                                <tbody style={{ textAlign: "justify" }}>
                                    <tr style={estiloTotales}>
                                        <td colSpan="4" style={estiloTotales} ><b>Caso escritura sencilla con fideicomiso</b></td>
                                    </tr>
                                    <tr>
                                        <td>Caso escritura sencilla con fideicomiso #1</td>
                                        <td>Cancelación, confección de 1 hasta 3 facilidades, contrato de fideicomiso, confeccion de 1 hasta 3 actas de sociedad</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$545.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check1"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch1(!switch1);
                                                    }}
                                                    checked={switch1}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr>
                                        <td>Caso escritura sencilla con fideicomiso #2</td>
                                        <td>Venta, confección de 1 hasta 3 facilidades, contrato de fideicomiso, confección de 1 hasta 3 actas de sociedad</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$580.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check2"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch2(!switch2);
                                                    }}
                                                    checked={switch2}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr>
                                        <td>Caso escritura sencilla con fideicomiso #3</td>
                                        <td>Confección de 1 hasta 3 facilidades, contrato de fideicomiso y confección de 1 hasta 3 actas de sociedad</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$498.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check3"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch3(!switch3);
                                                    }}
                                                    checked={switch3}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr>
                                        <td>Caso escritura sencilla con fideicomiso #4</td>
                                        <td>Confección de 1 hasta 3 facilidades, contrato de fideicomiso y confección de 1 hasta 3 actas de sociedad</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$680.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check4"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch4(!switch4);
                                                    }}
                                                    checked={switch4}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr style={estiloTotales}>
                                        <td colSpan="4"><b>Caso escritura compleja con fideicomiso</b></td>
                                    </tr>
                                    <tr>
                                        <td>Caso escritura compleja con fideicomiso #1</td>
                                        <td>Cancelación o desafectación de fincas, venta de fincas, confección de hasta 5 facilidades, contrato de fideicomiso y confección de 1 hasta 3 actas de sociedad</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$890.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check5"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch5(!switch5);
                                                    }}
                                                    checked={switch5}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr>
                                        <td>Caso de escritura con modificación a fideicomiso</td>
                                        <td>Adenda al contrato de fideicomiso</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$400.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check6"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch6(!switch6);
                                                    }}
                                                    checked={switch6}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr style={estiloTotales}>
                                        <td colSpan="4"><b>Caso escritura sencilla con hipoteca</b></td>
                                    </tr>
                                    <tr>
                                        <td>Caso escritura sencilla con hipoteca #1 </td>
                                        <td>Cancelación, confección de 1 hasta 3 facilidades  y confección de 1 hasta 3 actas de sociedad</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$460.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check7"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch7(!switch7);
                                                    }}
                                                    checked={switch7}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr>
                                        <td>Caso escritura sencilla con hipoteca #2</td>
                                        <td>Venta, confección de 1 hasta 3 facilidades, confección de 1 hasta 3 actas de sociedad</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$420.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check8"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch8(!switch8);
                                                    }}
                                                    checked={switch8}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr>
                                        <td>Caso escritura sencilla con hipoteca #3</td>
                                        <td>Cancelación o desafectación, venta de fincas, confección de 1 hasta 3 y confección de 1 hasta 3 actas de sociedad</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$450.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check9"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch9(!switch9);
                                                    }}
                                                    checked={switch9}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr>
                                        <td>Caso escritura sencilla con hipoteca #4</td>
                                        <td>Confección de 1 hasta 3 facilidades y confección de 1 hasta 3 actas de sociedad</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$370.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check10"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch10(!switch10);
                                                    }}
                                                    checked={switch10}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr style={estiloTotales}>
                                        <td colSpan="4"><b>Caso escritura compleja con Hipoteca</b></td>
                                    </tr>
                                    <tr>
                                        <td>Caso escritura compleja con hipoteca #1</td>
                                        <td>cancelación o desafectación de fincas, venta de fincas, hasta 5 facilidades, contrato de fideicomiso y confección de 1 a 3 actas de sociedad</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$625.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check11"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch11(!switch11);
                                                    }}
                                                    checked={switch11}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr>
                                        <td>Caso de escritura con modificación a hipoteca (adenda)</td>
                                        <td>Adenda al contrato de hipoteca</td>
                                        <td style={{ textAlign: "right" }}><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" value="$375.00" /></td>

                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check12"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch12(!switch12);
                                                    }}
                                                    checked={switch12}
                                                />
                                            </AvGroup>
                                        </td>
                                    </tr>
                                    <tr>
                                        <td></td>
                                        <td style={{ textAlign: "right" }}><b>Total cósto de notaria</b></td>
                                        <td style={{ textAlign: "right" }}><b><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" />${currencyData.format(parseFloat(total).toFixed(2) ?? 0)}</b></td>
                                        <td></td>
                                    </tr>
                                </tbody>
                            </Table>
                        </div>
                    </Col>
                </Row>
            </AvForm>
        </React.Fragment>
    );
}
export default CostosNotaria;
